const resolvers = {
  Query: {
    getCompanies: (parent, { page, limit }) => {
      const startIndex = (page - 1) * limit;
      const endIndex = page * limit;
      const companies = data;
      return companies.slice(startIndex, endIndex);
    },
    getAllCompanies: () => data,
  },
  Mutation: {
    deleteMyObject: (parent, args) => {
      const companiesToDelete = data;
      const index = companiesToDelete.findIndex((obj) => obj.id === args.id);
      if (index === -1) {
        throw new Error(`Object with ID ${args.id} not found`);
      }
      companiesToDelete.splice(index, 1);
      return true;
    },

    deleteMyObjects: (parent, args) => {
      const companiesToDelete = data;
      const { ids } = args;
      ids.forEach((element) => {
        const innerElement = companiesToDelete.find((item) => item.id === element);
        const innerIndex = companiesToDelete.indexOf(innerElement);
        companiesToDelete.splice(innerIndex, 1);
      });
      return true;
    },
  },
};
const server = new ApolloServer({
  typeDefs,
  resolvers,
});

const { url } = await startStandaloneServer(server, { listen: { port: 4000 } });

console.log(` Server listening at: ${url}`);
